INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 1, "フリーマーケット会場", 8, 7, 0, 2, 5118061, 91002, "青空の下で謁見", "ペコリーヌとの出会い", 2834, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 1, "フリーマーケット会場", 8, 7, 0, 2, 5118062, 91002, "未来の騎空団\nマスコット？", "マホとの出会い", 2835, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 1, "ランドソル市街地", 8, 7, 0, 2, 5118063, 91002, "お嬢さまからの\n緊急依頼", "アキノとの出会い", 2837, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 1, "フリーマーケット会場", 8, 18, 0, 2, 5118064, 91002, "黄金色の悩みごと", "ジュンとの出会い", 4108402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 1, "フリーマーケット会場", 8, 18, 0, 2, 5118065, 91002, "白熱！　格闘大会！", "カオリとの出会い", 4107402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "オーエド町", 8, 16, 1, 2, 5118066, 91002, "祭り太鼓はオーエドの華", "ニノンとの出会い", 9000227, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 1, "フリーマーケット会場", 8, 19, 0, 3, 5118067, 91002, "人気者は遅れて\nやってくる", "スズナとの出会い", 2101181, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 1, "ランドソル市街地", 8, 18, 0, 3, 5118068, 91002, "巫女・ミーツ・魔法少女", "ナナカとの出会い", 4109402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 1, "フリーマーケット会場", 8, 18, 0, 3, 5118069, 91002, "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 4305402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 1, "ランドソル市街地", 8, 18, 0, 3, 5118070, 91002, "この出会いにカンパイ！", "ユカリとの出会い", 4101402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 1, "ランドソル市街地", 8, 18, 0, 3, 5118071, 91002, "陰陽アンサンブル", "アオイとの出会い", 4106402, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "フリーマーケット会場", 8, 7, 1, 3, 5118072, 91002, "運試し十番勝負！", "シノブとの出会い", 2836, 40, 0);
INSERT INTO `v1_9e412c67ab368e1cecc397c6c809ce19d4dc607d1381f5fd425d911b23a833d4` VALUES (10118, 0, 0, 0, 0, 0, 0, 1, 5118600, 0, "彼女たちの新たな日常", "オープニング", 0, 0, 10145115);
